import React from 'react'
import './Menu.css';
import { Link } from 'react-router-dom';
import MenuLogo from './logo.png'

function Menu() {
    return (
        <div>
            <div className="menu">
                <Link to="/products" className='menu-icon'>
                    <img src= {MenuLogo} alt= 'icon' width = "50px" height = "50px"/>
                </Link>
            </div>
        </div>
    )
}

export default Menu
